  true,\n\t\"url\": null,\n\t\"notes\": \"The Remote Maintenance and Monitoring System
  (RMMS) is a collection of subsystems that includes telecommunication components,
  hardware, and software, which serve to automate and streamline the maintenance and
  operations of the National Airspace System (NAS).  Functions supported via the Remote
  Maintenance Monitoring system include equipment monitoring, outage reporting, control,
  certification, automated logging, and configuration management.  RMMS subsystems
  consist of the Remote Monitoring System (RMS) hardware on the remote systems to
  be monitored, the Maintenance Automation System Software and Control Function (MASS
  / MCF).There are approximately 5,000 RMS units in service.\",\n\t\"license_title\":
